import React, { useState } from "react";
import logo from "./logo.svg";
import "./App.css";

const [fileUpload, setFileUpload] = useState<File[]>([]);
// const node = useRef<HTMLIFrameElement>(null);

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <input type="file" onChange={(val: any) => setFileUpload(val)} />
        <button onClick={post}>Upload</button>
      </header>
    </div>
  );
}

interface StatusData {
  status: string;
}

function post(): Promise<any> {
  console.log(fileUpload);
  const headers = {
    file: "@/Users/alex/sources/hack-a-thing-2-23w-alexander-chen-hack-a-thing-2/server/files/example.mp4",
    // "Content-Type": "multipart/form-data",
    // "Access-Control-Allow-Origin": "*",
    // "Access-Control-Allow-Methods": "POST,PATCH,OPTIONS",
  };
  console.log(fetch("http://localhost:5000"));

  return fetch("http://localhost:5000", {
    mode: "no-cors",
    method: "POST",
    // mode: "cors", // sending video
    headers: headers,
  })
    .then((response) => {
      console.log(response);
      return response;
    })
    .then((response) => response.json()) // Parse the response in JSON
    .then((response) => {
      console.log(response);
      return response as StatusData; // Cast the response type to our interface
    });
}

export default App;
